  PRIMARY KEY (`category_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;




CREATE TABLE `courses` (
  `course_id` int(11) NOT NULL AUTO_INCREMENT,
