  UNIQUE KEY `category_id` (`subject_id`),
  KEY `classid` (`subject_id`)
) ENGINE=MyISAM AUTO_INCREMENT=819 DEFAULT CHARSET=utf8;




CREATE TABLE `tbl_super_admins` (
  `sa_id` int(11) NOT NULL AUTO_INCREMENT,
